import React from "react";
import "./Login.css";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
function Login() {
  return (
    <div className="container-bg">
    <Container fluid>
      <Row>
        <Col>1 of 1</Col>
      </Row>
    </Container>
    </div>
  );
}
export default Login;
